function combine_var_assign(path){
    var parent = path.parentPath
    if (!parent) return
    if (parent.node.type != 'VariableDeclarator') return
    if (path.node != parent.node.id) return
    var bind = path.scope.bindings[path.node.name]
    if (bind.referencePaths.length == 0 && bind.constantViolations[0]){
        var cons = bind.constantViolations[0]
        parent.node.init = cons.node.right
        cons.remove()
    }
    if (bind.referencePaths.length > 0 && bind.constantViolations[0]){
        var vtogg = false
        path.getFunctionParent().traverse({
            Identifier: function(path){
                if (!vtogg && bind.referencePaths.indexOf(path) != -1){
                    vtogg = true
                }
                if (!vtogg && bind.constantViolations[0].node.left == path.node){
                    var cons = bind.constantViolations[0]
                    parent.node.init = cons.node.right
                    cons.remove()
                    vtogg = true
                }
            }
        })
    }
}

function use_var_assign(path){
    var parent = path.parentPath
    if (!parent) return
    if (!parent.node.init) return
    if (parent.node.type != 'VariableDeclarator') return
    if (path.node != parent.node.id) return
    var bind = path.scope.bindings[path.node.name]
    if (bind.constantViolations.length == 0){
        if (t.isLiteral(parent.node.init)){
            for (var i = 0; i < bind.referencePaths.length; i++) {
                bind.referencePaths[i].replaceWith(parent.node.init)
            }
            parent.remove()
        }
        else if (bind.referencePaths.length == 1){
            bind.referencePaths[0].replaceWith(parent.node.init)
            parent.remove()
        }
    }
}

function v_packtype(value){
    if (typeof value == 'number'){ return t.NumericLiteral(value) }
    if (typeof value == 'string'){ return t.StringLiteral(value) }
    if (typeof value == 'boolean'){ return t.BooleanLiteral(value) }
    if (value === undefined){ return t.Identifier('undefined') }
    if (value === null){ return t.Identifier('null') }
    if (value === NaN){ return t.Identifier('NaN') }
    throw TypeError(`not find value type ${typeof value}`)
}

function eval_literal(path){
    function can_bin(node){
        return t.isLiteral(node) || 
            (node.type == 'Identifier' && 
                (node.name == 'undefined' || node.name == 'null' || node.name == 'NaN')
            )
    }
    if (can_bin(path.node.left) && can_bin(path.node.right)){
        path.replaceWith(v_packtype(eval(path+'')))
    }
}


