function decompose_object(path){
    function get_mem_namer(node){
        var ret = {}
        if (!node.computed){
            ret.name = node.property.name
            return ret
        }else{
            if (t.isLiteral(node.property)){
                ret.name = node.property.value + ''
                return ret
            }
        }
    }
    function get_obj_name(node){
        if (t.isIdentifier(node)) return node.name
        if (t.isLiteral(node)) return node.value+''
    }

    var parent = path.parentPath
    if (!parent) return
    if (!(parent.node.type == 'VariableDeclarator')) return

    var props = path.node.properties
    var bind = path.scope.bindings[parent.node.id.name]
    if (!bind) return
    if (bind.constantViolations.length != 0) return

    var used_cache = []
    function find_prop(name){
        for (var i = props.length - 1; i >= 0; i--) {
            if (name == get_obj_name(props[i].key)){
                return props[i]
            }
        }
    }
    function clear_prop(){
        var new_props = []
        for (var i = props.length - 1; i >= 0; i--) {
            if (used_cache.indexOf(props[i]) == -1){
                new_props.push(props[i])
            }
        }
        path.node.properties = new_props
    }
    function replace_obj(path, prop){
        if (t.isLiteral(prop.value)){
            if (used_cache.indexOf(prop) == -1){ used_cache.push(prop) }
            path.replaceWith(prop.value)
            return true
        }
        if (t.isFunctionExpression(prop.value) && t.isCallExpression(path.parentPath.node)){
            if (prop.value.body.body.length == 1){
                if (prop.value.body.body[0].type == 'ReturnStatement'){
                    var rep = prop.value.body.body[0].argument
                }else{
                    var rep = prop.value.body.body[0]
                }
                if (used_cache.indexOf(prop) == -1){ used_cache.push(prop) }
                var args = [].concat(path.parentPath.node.arguments)
                var vars = prop.value.params
                var ast = parser.parse(generator(rep).code)
                for (var i = 0; i < vars.length; i++) {
                    traverse(ast, {Identifier: function(path){ 
                        if (path.node.name == vars[i].name){
                            path.replaceWith(args[i])
                        }
                    }})
                }
                path.parentPath.replaceWith(ast.program.body[0])
                return true
            }
        }
    }
    var refes = bind.referencePaths
    var rtogg = true
    for (var i = 0; i < refes.length; i++) {
        var namer;
        if (refes[i].parentPath.node.type == 'MemberExpression' && 
            refes[i].parentPath.node.object == refes[i].node && 
            (namer = get_mem_namer(refes[i].parentPath.node))){
            var _path = refes[i].parentPath
            var proper = find_prop(namer.name)
            if (!proper) return
            if (!replace_obj(_path, proper)){
                rtogg = false
            }
        }else{
            rtogg = false
        }
    }
    clear_prop()
    if (rtogg){
        path.parentPath.remove()
    }
}

